// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import PartnerReport from './components/PartnerReport';
import ShipForm from './components/forms/ShipForm'

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="bg-blue-600 text-white p-4 no-print">
          <div className="max-w-7xl mx-auto flex justify-between items-center">
            <h1 className="text-xl font-bold">Ship Management System</h1>
            <div className="space-x-4">
              <Link to="/" className="hover:text-blue-200">Dashboard</Link>
              <Link to="/reports" className="hover:text-blue-200">Partner Reports</Link>
              <Link to="/ships" className="hover:text-blue-200">Ships</Link>
            </div>
          </div>
        </nav>

        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/reports" element={<PartnerReport />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
